VALUES ('3256223664087', 'Feuilletés apéritif', 'Feuilletés épinards ricotta : pâte feuilletée dorée pur beurre** 65% ; garniture 35% : épinards 14.6%, RICOTTA 13.5%, préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), eau, arôme naturel (LAIT), OEUFS en poudre, sel, poivre. Feuilletés tomate : pâte feuilletée dorée pur beurre** 65 % ; garniture 34,5% : courgette, purée de tomates mi-réduite 5.3%, eau, poivron rouge, double concentré de tomates (3.2%), oignons rissolés (oignons, huile de tournesol), huile d\'olive vierge extra, tomates séchées marinées 1.7% (tomates (1.6%), huile de colza, origan, ail, sel), préparation à base d\'aubergines (aubergines grillées, huile de colza, vinaigre de Xéres, sel, origan, ail, correcteur d\'acidité : acide citrique), préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), sucre, sel, ail, poivre, persil, basilic, origan ; saupoudrage 0,5% : origan. Feuilletés saumon aneth : pâte feuilletée dorée pur beurre** 70% ; garniture 30% : SAUMON atlantique 9.6% (Salmo salar), eau, FROMAGE BLANC lisse, pulpe de saumon fumé 1.2% (pulpe de SAUMON atlantique (Salmo salar), sel), oignons rissolés (oignons, huile de tournesol), amidons transformés de pomme de terre, pulpe de SAUMON rose du Pacifique 1.1% (Oncorhynchus gorbuscha), jus de citron à base de concentré (conservateur: disulfite de sodium), préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), OEUFS en poudre, sel, aneth 0,02%. Feuilletés fromage gratinés : pâte feuilletée dorée pur beurre** 65% ; garniture 30,5% : eau, fromage fondu aux 4 fromages 6.1% (COMTE, FOURME, EMMENTAL, PARMIGIANO REGGIANO, eau, sel), fromage fondu 3% (FROMAGES, eau, sel), amidons transformés de pomme de terre, préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), arôme naturel (LAIT), OEUFS en poudre, sel ; saupoudrage 4,5% : EMMENTAL. **pâte feuilletée dorée pur beurre : farine de BLE, BEURRE 17.9%, eau, sel, LACTOSE, protéines de LAIT, CREME en poudre, OEUFS en poudre. % exprimés sur chaque variété d\'apéritif Traces éventuelles de graines de sésame, crustacés, mollusques, céleri, moutarde et fruits à coques.', 'https://static.openfoodfacts.org/images/products/325/622/366/4087/front_fr.21.400.jpg', '15.4', '9.5', '30.6', '1.9', '1.3', '6.1', '0.9', '0.354330708661417', '', '1');

